import React from 'react';
import * as service from '../services/user-account-service';

class Main extends React.Component {

    state = {
        users: [1,2]
    };

    componentDidMount() {
        const fetchedAccounts = service.fetchAllUserAccount();
        this.setState({
            users: fetchedAccounts
        });
    }

    render() {
        const items = this.state.users.map(user => <li>{user}</li>)
        return (

            <div>{items}</div>
        )
    }
}

export default Main;
